const ALWAYS_FAILS =
    "581e581c01000033223232222350040071235002353003001498498480048005"
const ALWAYS_SUCCEEDS = "4e4d01000033222220051200120011"
const HELLO_WORLD =
    "585e585c01000033322232323233223232322223335300c333500b00a0033004120012009235007009008230024830af38f1ab664908dd3800891a8021a9801000a4c24002400224c44666ae54cdd70010008030028900089100109100090009"
const HELLO_WORLD_PERSON =
    ""
const ANYONE_CAN_MINT =
    ""
const CONTEXT_EQUIVALENCE_TEST =
    ""
const GUESS_42_STAKE =
    "587a58780100003233322232323233223232225335300a333500900800233500700d4815040184d400d2411d496e636f727265637420646174756d2e2045787065637465642034322e001235002353003335738002008930930900090008900091199ab9a3375e00400200c00a24002244004244002400246ea00041"
const CUSTOM_GUESS_42_DATUM_42 =
    ""
