    ""

const HOLDER =
    "586c586a010000323222233335734646660020026eb0d5d09aba2357446ae88d5d11aba2357446ae88d5d118031802801119baf0013006005222333357346ae8c00892811999ab9a30023574200649448ccc014014d5d1002001a4c93124c4c9311aba13002001235573c6ea8005"

const TRUE = "4746010000224981"

const SWAP =
    ""
const NESTED_CONTAINER = "4e4d0100004bd6f7b42f5a205c8261"

function testCbor(name, cborHex) {
    console.log("Deserializing program " + name + "...")

    let program = deserializeUplc(
        `{"type": "PlutusScriptV2", "cborHex": "${cborHex}"}`
    )

    console.log(program.toString() + "\n")

    let seralizedCborHex = JSON.parse(program.serialize()).cborHex

    assertEq(
        cborHex,
        seralizedCborHex,
        `Deserialization - Serialization roundtrip produced different result in ${name}`
    )
}

export default async function main() {
    testCbor("Const1", CONST_1)

    testCbor("AlwaysFails", ALWAYS_FAILS)

    testCbor("AlwaysSucceeds", ALWAYS_SUCCEEDS)

    //testCbor("AlwaysSucceedsAlt", ALWAYS_SUCCEEDS_ALT);

    //testCbor("Vesting", VESTING);

    testCbor("HelloWorld", HELLO_WORLD)

    testCbor("HelloWorldPerson", HELLO_WORLD_PERSON)

    testCbor("AnyoneCanMint", ANYONE_CAN_MINT)

    testCbor("ContextEquivalenceTest", CONTEXT_EQUIVALENCE_TEST)

    testCbor("Guess42Stake", GUESS_42_STAKE)

    testCbor("CustomGuess42Datum42", CUSTOM_GUESS_42_DATUM_42)

    testCbor("MintingContextEquivalenceTest", MINTING_CONTEXT_EQUIVALENCE_TEST)

    testCbor("V2Script", V2_SCRIPT)

    testCbor("Holder", HOLDER)

    testCbor("True", TRUE)

    testCbor("Swap", SWAP)

    testCbor("Nested Container", NESTED_CONTAINER)
}
